  constructor(){
    super();

    this.state = {
      monsters: [
        {
          name: 'Frank'
        },
        {
          name: 'Dragon'
        },
        {
          name: 'NightFury'
        }
      ]
    }

  }

  render(){
    return (
      <div className="App">
          <h1>saravana</h1>
      </div>
    );
  }
}

export default App;
